import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import GameForm from './components/GameForm';


function App() {
  return (
    <Router>

      <Routes>
        <Route path='/preferences' element={<GameForm />}></Route>
      </Routes>
    </Router>
  );
}

export default App;
